const nameSignUp = {
    label: 'Nome*',
    placeholder: 'Digite seu nome'
}

const emailSignUp = {
    label: 'E-mail*',
    placeholder: 'Digite seu e-mail'
}

const passwordSignUp = {
    label: 'Senha*',
    placeholder: 'Digite sua senha',
    forgotPassword: ''
}

const confirmPasswordSignUp = {
    label: 'Repita a senha*',
    placeholder: 'Digite sua senha de novo',
    forgotPassword: ''
}

const emailLogin = {
    label: 'E-mail',
    placeholder: 'Digite seu e-mail'
}

const passwordLogin = {
    label: 'Senha',
    placeholder: 'Digite sua senha',
    forgotPassword: 'Esqueceu a senha?'
}

export {
    nameSignUp,
    emailSignUp,
    passwordSignUp,
    confirmPasswordSignUp,
    emailLogin,
    passwordLogin
};
